

drop table if exists adcompany;
create table adcompany(
	id		char(6),
    name	varchar(20),
    gender	int,	# 0男1女
    birthdate	varchar(20),
    email		varchar(25),
    card		varchar(20),	#身份证号码
    phone		varchar(15),
    nation		int,	# 民族
    post		varchar(20),	#行政职务
    title		varchar(20),		#专业职称
    majors		char(4),			# 研究专长
    education	int,		# 学历
    degree		char(4),	# 学位
    workcompany	varchar(30),	# 工作单位
    workphone	varchar(20),	# 办公电话
    address		varchar(50),	# 通讯地址,
    # major		int,	# 学科大类
    # majorone	int,	# 一级学科
    majortwo	int,	# 二级学科
    honor		char(4),
    company		char(5),
    register_time                  varchar(50),			# 注册时间
	cancellation_time               varchar(50),			# 注销时间
	frozen						varchar(20),			# 冻结时间
	frozen_reason				varchar(200),			# 冻结原因
    password					varchar(20),
    primary key(id)
);

